// D:\Application Developement\trading-confluence-dashboard\frontend\trade-wizard\src\components\AssetManager.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { TextField, Button } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const AssetManager = () => {
  const [assets, setAssets] = useState([]);
  const [newAsset, setNewAsset] = useState('');

  useEffect(() => {
    const fetchAssets = async () => {
      const response = await axios.get('/api/assets');
      setAssets(response.data);
    };

    fetchAssets();
  }, []);

  const addAsset = async () => {
    const response = await axios.post('/api/assets', { name: newAsset });
    setAssets([...assets, response.data]);
    setNewAsset('');
  };

  const removeAsset = async (id) => {
    await axios.delete(`/api/assets/${id}`);
    setAssets(assets.filter((asset) => asset._id !== id));
  };

  return (
    <div>
      <h1>Asset Manager</h1>
      <TextField 
        label="New Asset" 
        value={newAsset} 
        onChange={(e) => setNewAsset(e.target.value)} 
      />
      <Button onClick={addAsset} variant="contained" color="primary">
        Add Asset
      </Button>
      <ul>
        {assets.map((asset) => (
          <li key={asset._id}>
            {asset.name}
            <Button onClick={() => removeAsset(asset._id)}>
              <DeleteIcon />
            </Button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AssetManager;
